    13import { ToolModule } from "../types.js";
    14import * as fs from "fs";
    15import * as path from "path";
    16import * as crypto from "crypto";
    17
    18const WIKI_DIR = path.join(process.cwd(), "not-wikipedia");
    19const ECOSYSTEM_FILE = path.join(process.cwd(), "meta", "ecosystem.json");
    20const RESEARCHERS_FILE = path.join(process.cwd(), "meta", "researchers.json");
    21
    22interface HumanSeed {
    23  text: string;
    24  source: string;
    25  type: "quote" | "fallback";
    26}
    27
    28interface TaskSpec {
    29  taskType: "repair_broken_link" | "resolve_placeholder" | "fix_orphan" | "create_new" | "ecosystem_healthy";
    30  priority: "critical" | "high" | "medium" | "low";
    31  topic: {
    32    name: string;
    33    filename: string;
    34    context: string;
    35  };
    36  humanSeed?: HumanSeed;
    37  researcher: {
    38    name: string;
    39    field: string;
    40    institution: string;
    41    isNew: boolean;
    42  } | null;
    43  articleType: string;
    44  category: string;
    45  infoboxColor: string;
    46  randomSeed: string;
    47  ecosystemStats: {
    48    totalArticles: number;
    49    brokenLinks: number;
    50    orphans: number;
    51    placeholders: number;
    52  };
    53}
