    55function secureRandomInt(max: number): number {
    56  if (max <= 0) return 0;
    57  const randomBytes = crypto.randomBytes(4);
    58  const randomValue = randomBytes.readUInt32BE(0);
    59  return randomValue % max;
    60}
    61
    62function secureRandomElement<T>(arr: T[]): T | null {
    63  if (arr.length === 0) return null;
    64  return arr[secureRandomInt(arr.length)];
    65}
    66
    67// Available infobox colors (pick unused ones)
    68const INFOBOX_COLORS = [
    69  "#7b9e89", "#c9a86c", "#8b7355", "#d4a87a",
    70  "#a6c4d4", "#b8a8d4", "#98d1a8", "#e6c88a",
    71  "#9fc5e8", "#f9cb9c", "#b4a7d6", "#a2c4c9",
    72];
    73
    74// Article types for rotation
    75const ARTICLE_TYPES = [
    76  "phenomenon", "theory", "methodology", "practice",
    77  "institution", "biography", "historical_event", "case_study",
    78];
    79
    80// Categories to balance
    81const CATEGORIES = [
    82  "linguistics", "consciousness", "chronopsychology", "technology", "institutions",
    83];
    84
    85// Embedded fallback corpus for human seed inspiration
    86const FALLBACK_CORPUS: Array<{ text: string; source: string }> = [
    87  { text: "Call me Ishmael. Some years agonever mind how long preciselyhaving little or no money in my purse, and nothing particular to interest me on shore, I thought I would sail about a little and see the watery part of the world.", source: "Herman Melville, Moby-Dick" },
