    92  { text: "He who has a why to live can bear almost any how.", source: "Friedrich Nietzsche, Twilight of the Idols" },
    93  { text: "There is grandeur in this view of life, with its several powers, having been originally breathed into a few forms or into one.", source: "Charles Darwin, On the Origin of Species" },
    94  { text: "The cosmos is within us. We are made of star-stuff. We are a way for the universe to know itself.", source: "Carl Sagan, Cosmos" },
    95  { text: "I write entirely to find out what I'm thinking, what I'm looking at, what I see and what it means.", source: "Joan Didion, Why I Write" },
    96  { text: "Time is the substance I am made of. Time is a river which sweeps me along, but I am the river.", source: "Jorge Luis Borges, A New Refutation of Time" },
    97  { text: "The past is never dead. It's not even past.", source: "William Faulkner, Requiem for a Nun" },
    98  { text: "Perhaps one did not want to be loved so much as to be understood.", source: "George Orwell, 1984" },
    99  { text: "We are what we pretend to be, so we must be careful about what we pretend to be.", source: "Kurt Vonnegut, Mother Night" },
   100  { text: "The mind is its own place, and in itself can make a heaven of hell, a hell of heaven.", source: "John Milton, Paradise Lost" },
   101  { text: "Memory is the diary we all carry about with us.", source: "Oscar Wilde" },
   102  { text: "Two roads diverged in a yellow wood, and sorry I could not travel both.", source: "Robert Frost, The Road Not Taken" },
