   109async function fetchHumanSeed(): Promise<HumanSeed> {
   110  // Try Quotable API first
   111  try {
   112    const controller = new AbortController();
   113    const timeout = setTimeout(() => controller.abort(), 5000);
   114    const response = await fetch("https://api.quotable.io/random?minLength=50&maxLength=200", {
   115      signal: controller.signal
   116    });
   117    clearTimeout(timeout);
   118    if (response.ok) {
   119      const data = await response.json();
   120      return { text: data.content, source: data.author, type: "quote" };
   121    }
   122  } catch {
   123    // Fall through to fallback
   124  }
   125
   126  // Use fallback corpus
   127  const index = secureRandomInt(FALLBACK_CORPUS.length);
   128  const passage = FALLBACK_CORPUS[index];
   129  return { text: passage.text, source: passage.source, type: "fallback" };
   130}
