   132function getEcosystemState() {
   133  const state = {
   134    brokenLinks: [] as { target: string; sources: string[] }[],
   135    placeholders: [] as string[],
   136    orphans: [] as string[],
   137    articleCount: 0,
   138    usedColors: [] as string[],
   139    categoryBalance: {} as Record<string, number>,
   140  };
   141
   142  try {
   143    const files = fs.readdirSync(WIKI_DIR).filter(f => f.endsWith(".html"));
   144    state.articleCount = files.length;
   145
   146    const incomingLinks: Map<string, number> = new Map();
   147    files.forEach(f => incomingLinks.set(f, 0));
   148
   149    for (const file of files) {
   150      const filePath = path.join(WIKI_DIR, file);
   151      const content = fs.readFileSync(filePath, "utf-8");
   152
   153      // Check broken links
   154      const linkMatches = content.matchAll(/href="([^"]*\.html)"/g);
   155      for (const match of linkMatches) {
   156        const link = match[1];
   157        if (!fs.existsSync(path.join(WIKI_DIR, link))) {
   158          const existing = state.brokenLinks.find(b => b.target === link);
   159          if (existing) {
   160            existing.sources.push(file);
   161          } else {
   162            state.brokenLinks.push({ target: link, sources: [file] });
   163          }
   164        } else {
   165          incomingLinks.set(link, (incomingLinks.get(link) || 0) + 1);
   166        }
   167      }
   168
   169      // Check placeholders
   170      if (content.includes("NEXT_PAGE_PLACEHOLDER")) {
   171        state.placeholders.push(file);
   172      }
   173
   174      // Extract used colors
   175      const colorMatch = content.match(/background-color:\s*(#[a-fA-F0-9]{6})/);
   176      if (colorMatch) {
   177        state.usedColors.push(colorMatch[1].toLowerCase());
   178      }
   179    }
   180
   181    // Find orphans
   182    for (const [file, count] of incomingLinks) {
   183      if (file !== "index.html" && count === 0) {
   184        state.orphans.push(file);
   185      }
   186    }
   187
   188    // Load category balance
   189    if (fs.existsSync(ECOSYSTEM_FILE)) {
   190      const ecosystem = JSON.parse(fs.readFileSync(ECOSYSTEM_FILE, "utf-8"));
   191      state.categoryBalance = {};
   192      for (const [cat, data] of Object.entries(ecosystem.categories || {})) {
   193        state.categoryBalance[cat] = (data as any).article_count || 0;
   194      }
   195    }
   196
   197  } catch (error) {
   198    // Continue with partial state
   199  }
   200
   201  return state;
   202}
   203
   204function getAvailableResearcher(): { name: string; field: string; institution: string; isNew: boolean } | null {
   205  try {
   206    if (fs.existsSync(RESEARCHERS_FILE)) {
   207      const data = JSON.parse(fs.readFileSync(RESEARCHERS_FILE, "utf-8"));
   208
   209      // 20% chance to suggest new researcher
   210      if (secureRandomInt(5) === 0 && data.suggested_new_researchers?.length > 0) {
   211        const newR = secureRandomElement(data.suggested_new_researchers) as { name: string; field: string; institution: string } | null;
   212        if (newR) {
   213          return {
   214            name: newR.name,
   215            field: newR.field,
   216            institution: newR.institution,
   217            isNew: true,
   218          };
   219        }
   220      }
   221
   222      // Get available researchers
   223      const available: any[] = [];
   224      for (const [key, r] of Object.entries(data.researchers || {})) {
   225        const researcher = r as any;
   226        if (researcher.status?.includes("AVAILABLE")) {
   227          available.push(researcher);
   228        }
   229      }
   230
   231      if (available.length > 0) {
   232        const selected = secureRandomElement(available);
   233        if (selected) {
   234          return {
   235            name: selected.name,
   236            field: selected.field,
   237            institution: selected.institution,
   238            isNew: false,
   239          };
   240        }
   241      }
   242    }
   243  } catch (error) {
   244    // Return null on error
   245  }
   246  return null;
   247}
   248
   249async function selectNextTask(): Promise<TaskSpec> {
   250  const randomSeed = crypto.randomBytes(8).toString("hex");
   251  const state = getEcosystemState();
   252  const researcher = getAvailableResearcher();
   253
   254  // Pick unused color
   255  const availableColors = INFOBOX_COLORS.filter(c => !state.usedColors.includes(c.toLowerCase()));
   256  const infoboxColor = secureRandomElement(availableColors) || secureRandomElement(INFOBOX_COLORS) || "#b0c4de";
   257
   258  // Pick article type (rotate through them)
   259  const articleType = secureRandomElement(ARTICLE_TYPES) || "phenomenon";
   260
   261  // Pick underrepresented category
   262  let category = "linguistics";
   263  const minCount = Math.min(...Object.values(state.categoryBalance).filter(v => v > 0), 999);
   264  const underrepresented = Object.entries(state.categoryBalance)
   265    .filter(([_, count]) => count <= minCount + 1)
   266    .map(([cat, _]) => cat);
   267  if (underrepresented.length > 0) {
   268    category = secureRandomElement(underrepresented) || category;
   269  }
   270
   271  const ecosystemStats = {
   272    totalArticles: state.articleCount,
   273    brokenLinks: state.brokenLinks.length,
   274    orphans: state.orphans.length,
   275    placeholders: state.placeholders.length,
   276  };
   277
   278  // Priority 1: Broken links (CRITICAL)
   279  if (state.brokenLinks.length > 0) {
   280    // Sort by number of sources (most referenced first)
   281    state.brokenLinks.sort((a, b) => b.sources.length - a.sources.length);
   282    const selected = secureRandomElement(state.brokenLinks) || state.brokenLinks[0];
   283    const topicName = selected.target.replace(".html", "").split("-")
   284      .map(w => w.charAt(0).toUpperCase() + w.slice(1)).join(" ");
   285
   286    return {
   287      taskType: "repair_broken_link",
   288      priority: "critical",
   289      topic: {
   290        name: topicName,
   291        filename: selected.target,
   292        context: `Referenced by ${selected.sources.length} article(s): ${selected.sources.join(", ")}`,
   293      },
   294      researcher,
   295      articleType,
   296      category,
   297      infoboxColor,
   298      randomSeed,
   299      ecosystemStats,
   300    };
   301  }
   302
   303  // Priority 2: Placeholders (HIGH)
   304  if (state.placeholders.length > 0) {
   305    const sourceFile = secureRandomElement(state.placeholders) || state.placeholders[0];
   306    return {
   307      taskType: "resolve_placeholder",
   308      priority: "high",
   309      topic: {
   310        name: "PLACEHOLDER_RESOLUTION",
   311        filename: sourceFile,
   312        context: `File ${sourceFile} contains unresolved NEXT_PAGE_PLACEHOLDER`,
   313      },
   314      researcher,
   315      articleType,
   316      category,
   317      infoboxColor,
   318      randomSeed,
   319      ecosystemStats,
   320    };
   321  }
   322
   323  // Priority 3: Orphans (MEDIUM)
   324  if (state.orphans.length > 0) {
   325    const orphan = secureRandomElement(state.orphans) || state.orphans[0];
   326    return {
   327      taskType: "fix_orphan",
   328      priority: "medium",
   329      topic: {
   330        name: orphan.replace(".html", ""),
   331        filename: orphan,
   332        context: `This article has no incoming links. Add references from related articles.`,
   333      },
   334      researcher,
   335      articleType,
   336      category,
   337      infoboxColor,
   338      randomSeed,
   339      ecosystemStats,
   340    };
   341  }
   342
   343  // Priority 4: Create new content (LOW - ecosystem is healthy)
   344  // Fetch human-written text as creative inspiration
   345  const humanSeed = await fetchHumanSeed();
   346
   347  return {
   348    taskType: "create_new",
   349    priority: "low",
   350    topic: {
   351      name: "INSPIRED_BY_SEED",
   352      filename: "to-be-determined.html",
   353      context: "Ecosystem is healthy. Use the humanSeed as a topic spark to create new content.",
   354    },
   355    humanSeed,
   356    researcher,
   357    articleType,
   358    category,
   359    infoboxColor,
   360    randomSeed,
   361    ecosystemStats,
   362  };
   363}
   364
   365export const tool: ToolModule = {
   366  definition: {
   367    name: "wiki_next_task",
   368    description: "Get the next task for the Not-Wikipedia autonomous agent. Uses cryptographically secure randomness combined with ecosystem state to select: task type, researcher, article type, category, and infobox color. For new content creation, fetches a human-written text passage (quote or literary excerpt) as creative inspiration. Returns a complete task specification.",
   369    inputSchema: {
   370      type: "object",
   371      properties: {},
   372      required: [],
   373    },
   374  },
   375
   376  handler: async () => {
   377    const task = await selectNextTask();
   378    return {
   379      content: [{
   380        type: "text",
   381        text: JSON.stringify(task, null, 2),
   382      }],
   383    };
   384  },
   385};
